    <div className="col">
      <div className="card" style={cardStyle}>
        <img src={props.image} className="card-img-top "  style={img-style} alt="error" />
        <div className="card-body">
          <h5 className="card-title">{props.name}</h5>
          <p className="card-text">{props.jop}</p>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">{`phone: ${props.phone}`}</li>
            <li className="list-group-item">{`email: ${props.email}`}</li>
            <li className="list-group-item">{`website: ${props.website}` }</li>
          </ul>
        </div>
      </div>
    </div>
    
  );
}
export default ProgrammersCard;
